NominationType.create!([
  {year: "2016", code: "Packard", title: "David Packard Excellence in Acquisition Award ", description: "The David Packard Excellence in Acquisition Award, sponsored by the Under Secretary of Defense for Acquisition, Technology, and Logistics (USD(AT&L)), recognizes Department of Defense civilian and military organizations, groups, or teams who have demonstrated exemplary innovation and best practices in the acquisition of products and services. This award reflects achievements that exemplify goals and objectives established for furthering life cycle cost reduction and/or acquisition excellence in the Department. Multiple teams may receive the award based on merit. This call for nominations application is for nominations from the U.S. Army. The U.S. Army Acquisition Support Center (USAASC) is the official collection point for U.S. Army nominations. USAASC will compile the nominations and submit to senior leadership, who will then select and forward the Army submissions to USD(AT&L) for consideration. ", awards_announcement: "2016-DOD-Award-Announcement-Memo.pdf", implementing_instructions: "2016-packard-instructions.pdf", submission_form: "2016-packard-submission.docx", award_narrative: "2016-packard-example.pdf", guidelines: nil, nomination_end_date: "05/31/2016"},
  {year: "2016", code: "Should", title: "USD(AT&L) Should Cost and Innovation Award", description: "The Should Cost and Innovation Award specifically targets organizations that have displayed outstanding commitment, innovation, and results to should-cost management. It recognizes organizations, groups or teams that have displayed outstanding commitment, innovation, and results to should cost management. As a core, enduring BBP initiative, most programs and contracted activities in DOD now have should-cost targets and are managing to them. ", awards_announcement: "2016-DOD-Award-Announcement-Memo.pdf", implementing_instructions: "2016-should-cost-instructions.pdf", submission_form: "2016-should-submission.docx", award_narrative: "2016-should-cost-example.pdf", guidelines: nil, nomination_end_date: "05/31/2016"},
  {year: "2016", code: "Development", title: "Defense Acquisition Workforce Development Award", description: "The Defense Acquisition Workforce Development Award recognizes organizations that have displayed outstanding commitment, innovation, and results to develop and support the success of their acquisition, technology and logistics professionals.\r\n\r\nThe U.S. Army Acquisition Support Center (USAASC) is the official collection point for U.S. Army nominations. USAASC will compile the nominations and submit to senior leadership, who will then select and forward the Army submissions to USD(AT&L) for consideration.", awards_announcement: "2016-DOD-Award-Announcement-Memo.pdf", implementing_instructions: "2016-development-instructions.pdf", submission_form: "2016-development-submission.docx", award_narrative: "2016-development-example.pdf", guidelines: nil, nomination_end_date: "05/31/2016"},
  {year: "2016", code: "Achievement", title: "Defense Acquisition Workforce Achievement Award", description: "The Defense Acquisition Workforce Individual Achievement Award has been established to encourage and recognize excellent performance by members of the Defense Acquisition Workforce in the acquisition of products and services for the DOD. This program recognizes individuals (military or civilian) who represent the best in the various acquisition workforce disciplines.", awards_announcement: "2016-DOD-Award-Announcement-Memo.pdf", implementing_instructions: "2016-achievement-instructions.pdf", submission_form: "2016-achievement-submission.docx", award_narrative: "2016-achievement-example.pdf", guidelines: nil, nomination_end_date: "05/31/2016"},
